import React from 'react';
import s from './Categories.module.css'
import Category from "./Category/Category";
import {BrowserRouter, Router, Routes, Route, Switch} from "react-router-dom";

import archtect from './architect.svg';
import auto from './auto.svg';
import household from './household.svg'

import {
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
} from "../redux/UrlReducer";

const Categories = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={IMMOVABLES.name} imgPath={archtect} urlCategory={IMMOVABLES.url} className={s.categories}/>
            <Category nameCategory={TRANSPORT.name} imgPath={auto} urlCategory={TRANSPORT.url} className={s.categories}/>
            <Category nameCategory={HOUSEHOLD.name} imgPath={household} urlCategory={HOUSEHOLD.url} className={s.categories}/>
          </div>
        </div>
      </div>
  );
};

export default Categories;
